import React from "react";
import "./About.css";

//creo el componente funcional About que se mostrará en la ruta /about
export default function About() {
    return (
        <><header class="header">
            <h1 class="glitched">Glitch</h1>
        </header><a class="inspiration-button" href="http://www.theverge.com/a/luka-artificial-intelligence-memorial-roman-mazurenko-bot" target="_blank">Inspiration</a></>
    )
}
